    var search_recommend = function(e){
        if(e.key == 'Backspace'){
            if(keyword.length !=0){
                
                setKeyword(keyword.substring(0, keyword.length-1))
            }
            
        }else{
            
            setKeyword(keyword + e.key)
        }
        console.log(keyword)
        
       
    } 
    var preventDeafault = function(e){
        e.preventDeafault()
        return false
    }
    return (
        <div>
            안녕안녕
            <form onSubmit= "return preventDeafault()" >
                <input onKeyDown={search_recommend} ></input>
            </form>
        </div>
    )
}
